import React from "react";
import { Input, Form, Button } from "antd";

const dummy = {
  isLoggedIn: true,
  imagePaths: []
};
const Home = () => {
  return (
    <>
      <div>
        {dummy.isLoggedIn && (
          <div>
            <Form encType="multipart/form-data">
              <Input.TextArea
                maxLength={140}
                placeholder="어떤 신기한 일이 있었나요?"
              ></Input.TextArea>
              <div>
                <Button>이미지 업로드</Button>
                <Button
                  type="primary"
                  style={{ float: "right" }}
                  htmlType="submit"
                >
                  짹짹
                </Button>
              </div>
              <div>
                {dummy.imagePaths.map((v, i) => {
                  return (
                    <div key={v} style={{ display: "inline-block" }}>
                      <img
                        src={"http://localhost:3065/"}
                        style={{ width: "200px" }}
                        alt={v}
                      ></img>
                      <div>
                        <Button>제거</Button>
                      </div>
                    </div>
                  );
                })}
              </div>
            </Form>
            {dummy.mainPosts.map(c => {
              return (
                <Card
                  key={+c.createdAt}
                  cover={
                    c.img && (
                      <img
                        alt="example"
                        src={c.img}
                        actions={[
                          <Icon type="retweet" key="retweet"></Icon>,
                          <Icon type="heart" key="heart"></Icon>,
                          <Icon type="message" key="message"></Icon>,
                          <Icon type="ellipsis" key="ellipsis"></Icon>
                        ]}
                      >
                        ex
                      </img>
                    )
                  }
                ></Card>
              );
            })}
          </div>
        )}
      </div>
    </>
  );
};
// 2-4 00:22
export default Home;
